import "./MysteryBingoIntroPage.css";
import { Link } from "react-router-dom";
import mistypesData from "../mistypesData.json";

function MysteryBingoIntroPage() {
  const myName = localStorage.getItem("myName");
  const myMbti = localStorage.getItem("myMbti");
  const myMistypes = mistypesData.find((obj) => obj.id == myMbti).mistypes;
  // const myMistypes = mistypesData.find

  console.log(mistypesData);

  return (
    <>
      <h2 className="mystery-intro-title">
        <span className="accent color">
          {myMbti} {myName}{" "}
        </span>
        님의 <span className="accent highlight color">진짜 MBTI</span>는?!
      </h2>

      <div className="mysterybingo-p">
        {myMbti} 맞춤형 미스테리 빙고판이
        <br />
        {myMistypes.length}개 준비되어 있어요!
      </div>

      <div>
        <Link
          to="/mysterybingo"
          className="btn"
          // onClick={(e) => localStorage.setItem("myMistypes", myMistypes)}
          onClick={localStorage.setItem(
            "myMistypes",
            JSON.stringify(myMistypes)
          )}
        >
          미스테리 빙고 풀러가기!
        </Link>
      </div>
    </>
  );
}

export default MysteryBingoIntroPage;
